import React from 'react';

const perks = [
  'Priority hackathon slots & internal build sprints',
  'Weekly curated tech trend & opportunity digest',
  'Access to mentorship circles & AMA sessions',
  'Private internship / freelance / founder boards',
  'Learning tracks (AI, Web3, Cloud, DevOps, Product)',
  'Resume / portfolio & mock interview reviews',
  'Early feature testing & community leadership roles'
];

const MembershipBenefits = () => (
  <section className="membership-benefits">
    <h3>Why Become a Member?</h3>
    <div className="perk-grid">
      {perks.map(p => (
        <div className="perk" key={p}>{p}</div>
      ))}
    </div>
  </section>
);

export default MembershipBenefits;
